import React, { useState } from 'react';
import { ChevronLeft, ChevronRight } from 'lucide-react';
import '../css/Testimonials.css';

const Testimonials = () => {
  const [currentIndex, setCurrentIndex] = useState(0);

  const testimonials = [
    {
      id: 1,
      content: "LearnHub completely transformed my career. I went from knowing nothing about programming to landing a job as a full-stack developer in just 6 months. The courses are well-structured and the instructors are amazing!",
      author: "Alex Morgan",
      role: "Software Developer",
      company: "TechCorp",
      avatar: "/api/placeholder/64/64"
    },
    {
      id: 2,
      content: "As someone running a small business, the marketing courses on LearnHub have been invaluable. I've been able to implement strategies that have doubled our online presence and increased sales by 40%.",
      author: "Samantha Lee",
      role: "Business Owner",
      company: "Bloom Boutique",
      avatar: "/api/placeholder/64/64"
    },
    {
      id: 3,
      content: "The quality of instruction on LearnHub is unmatched. I've tried many online learning platforms, but the depth of content and the engagement from instructors here make it stand out. Worth every penny!",
      author: "James Wilson",
      role: "Project Manager",
      company: "InnovateTech",
      avatar: "/api/placeholder/64/64"
    }
  ];

  const nextSlide = () => {
    setCurrentIndex((prevIndex) => (prevIndex === testimonials.length - 1 ? 0 : prevIndex + 1));
  };

  const prevSlide = () => {
    setCurrentIndex((prevIndex) => (prevIndex === 0 ? testimonials.length - 1 : prevIndex - 1));
  };

  return (
    <section className="testimonials-section">
      <div className="testimonials-container">
        <div className="testimonials-header">
          <h2 className="testimonials-title">What Our Students Say</h2>
          <p className="testimonials-subtitle">
            Hear from our community of learners who have achieved their goals through our platform
          </p>
        </div>

        <div className="testimonial-card-wrapper">
          <div className="testimonial-card">
            <div className="testimonial-content">
              <svg className="testimonial-quote-icon" fill="currentColor" viewBox="0 0 32 32">
                <path d="M9.352 4C4.456 7.456 1 13.12 1 19.36c0 5.088 3.072 8.064 6.624 8.064 3.36 0 5.856-2.688 5.856-5.856 0-3.168-2.208-5.472-5.088-5.472-.576 0-1.344.096-1.536.192.48-3.264 3.552-7.104 6.624-9.024L9.352 4zm16.512 0c-4.8 3.456-8.256 9.12-8.256 15.36 0 5.088 3.072 8.064 6.624 8.064 3.264 0 5.856-2.688 5.856-5.856 0-3.168-2.304-5.472-5.184-5.472-.576 0-1.248.096-1.44.192.48-3.264 3.456-7.104 6.528-9.024L25.864 4z" />
              </svg>

              <p className="testimonial-text">{testimonials[currentIndex].content}</p>

              <div className="testimonial-author">
                <img 
                  src={testimonials[currentIndex].avatar} 
                  alt={testimonials[currentIndex].author} 
                  className="testimonial-avatar"
                />
                <div>
                  <h4 className="testimonial-author-name">{testimonials[currentIndex].author}</h4>
                  <p className="testimonial-author-role">{testimonials[currentIndex].role} at {testimonials[currentIndex].company}</p>
                </div>
              </div>
            </div>
          </div>

          <div className="testimonial-arrow-left">
            <button onClick={prevSlide} className="testimonial-arrow-button">
              <ChevronLeft className="arrow-icon" />
            </button>
          </div>

          <div className="testimonial-arrow-right">
            <button onClick={nextSlide} className="testimonial-arrow-button">
              <ChevronRight className="arrow-icon" />
            </button>
          </div>

          <div className="testimonial-indicators">
            {testimonials.map((_, index) => (
              <button
                key={index}
                onClick={() => setCurrentIndex(index)}
                className={`testimonial-indicator ${index === currentIndex ? 'active' : ''}`}
                aria-label={`Go to testimonial ${index + 1}`}
              />
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default Testimonials;
